def ols(data):
	global percent_sort
	betas = ['nd']
	#print(data)
	if percent_sort:
		ln = len(data)
		if ln > 1:
			min_data = min(data)
			betas = [((data[0] - min_data) / min_data * 100), 0]
	else:
		if len(data) > 1:
			x = []
			x.append(range(len(data)))                 #Time variable
			x.append([1 for ele in range(len(data))]) #This adds the intercept, use range in Python3

			y = np.matrix(data).T
			x = np.matrix(x).T

			betas = ((x.T*x).I*x.T*y)
			betas = [betas.item(0), 0]

	return betas

