def get_range(data, end):
	total = []
	if len(data) > end:
		total = data[:end]
	return total

def sort_ols(data):
	trl = {}
	list_d = list(data.items())
	list_d.sort(key=lambda i: i[1], reverse=True)

	return list_d

def show_top(data, period):
	global top, aldata, percent_sort
	text = ""
	i = 0

	if percent_sort:
		per = "%"
	else:
		per = ""

	for coin in data:
		if coin[1] > 0:
			color = '\033[0;32m'
		else:
			color = '\033[0;31m'
		notification(coin[0][:-4], coin[1], period)
		i += 1
		text = "{}\033[1;30;47m{}\033[0;0m ({}{}{}\033[0;0m);\t\t".format(text, coin[0][:-4], color, round(coin[1], 2), per)
		if (i >= top):
			break
	return text
